document.addEventListener("DOMContentLoaded",(function(){const e=document.querySelector(".main"),t=document.querySelector(".header");e.style.paddingTop=`${t.clientHeight+30}px`;(new class{constructor(e,t){this.owlElement=e,this.owlOptions=t}addSlider(e,t){$(e).owlCarousel(t)}}).addSlider(".slider",{items:2,margin:30})}));